import React from "react"
import Draggable from 'react-draggable';
import './symbols.css'
import './style.css'
import './Desktop.js'
import './desktop.css'
import folder from './folder.jpg'

export default function Symbols() {
  let isDragging = true;
  function onDrag(e) {
    console.log("onDrag");
    isDragging = true;
  }
  function onStop(e) {
    console.log("onStop");

  }
  function onClick(e) {
    console.log("onclick");
    setTimeout(() => (isDragging = false), 0);
  }
  return (

        <div id="each-icon">
              <div>
                <img id="icons-pic" src={folder} alt="imp"></img>
                <p id="icon-name">hello</p>
              </div>
      </div>
    )
};
